import React from "react";

import "./CardStats.css";

const CardStats = (props) => {
  console.log(props.location.state.name);
  const name = props.location.state;

  return (
    <div className="stats--container">
      <h1>Hi</h1>
      <h2>{name}</h2>
    </div>
  );
};

export default CardStats;
